import React from 'react'
import Navbar from './components/layout/Navbar'
import Sidebar from './components/layout/Sidebar'
import Home from './components/pages/Home'
import Modal from './components/misc/Modal';

function App() {
    return (
        <>
            <Navbar/>
            <Sidebar/>
            <Home/>
            <Modal/>
        </>
    )
}

export default App
